css:
.project-manager input {
  width: 100%;
}
.project-manager-list-group {
  color: #848474;
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: #54544d;
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #b0b6b6;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #ff255b;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
